const initialState = {
  updater: true,
};

const reducer = (state = initialState, action) => {
  console.log(action.payload)
  switch (action.type) {
    case "updateValue":
      return { ...state, updater: action.payload};

    default:
      return state;
  }
};

export default reducer;
